      <div className="search"><input placeholder="Arama Yap" /> <button>Ara</button></div>
      <div className="menu">
        <ul>
          <li><a href="/login">Giri≈ü Yap</a></li>
          <li><a href=""></a></li>
        </ul>
      </div>
    </div>
  );
}

export default Header;
